package saif.casetas.demoOcr.classes;

public class CambioNoReconocidoBody {
	private int cve_entrada, cve_vehiculo;
	private  String placa, numero_economico, marca;
	
	public CambioNoReconocidoBody() {
		// TODO Auto-generated constructor stub
	}

	public int getCve_entrada() {
		return cve_entrada;
	}

	public void setCve_entrada(int cve_entrada) {
		this.cve_entrada = cve_entrada;
	}

	public int getCve_vehiculo() {
		return cve_vehiculo;
	}

	public void setCve_vehiculo(int cve_vehiculo) {
		this.cve_vehiculo = cve_vehiculo;
	}

	public String getPlaca() {
		return placa;
	}

	public void setPlaca(String placa) {
		this.placa = placa;
	}

	public String getNumero_economico() {
		return numero_economico;
	}

	public void setNumero_economico(String numero_economico) {
		this.numero_economico = numero_economico;
	}

	public String getMarca() {
		return marca;
	}

	public void setMarca(String marca) {
		this.marca = marca;
	}

}
